import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the product cards to be dynamically rendered by the script
    await page.waitForSelector('.product-card .product-price', { timeout: 5000 });

    // Take a screenshot after products are loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Extract all price texts using a locator
    const priceElements = page.locator('.product-price');
    const allPriceTexts = await priceElements.allTextContents();

    // Process the extracted texts to get only the current price
    const extractedPrices = allPriceTexts.map(text => {
      // The text might contain the current price and original price, e.g., "$59.50 $79.99"
      // We split by whitespace and take the first part.
      return text.trim().split(/\s+/)[0];
    });

    if (extractedPrices.length === 0) {
      throw new Error('No product prices were found on the page.');
    }

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: extractedPrices,
        priceCount: extractedPrices.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
